(* ::Subsection:: *)
(*PlotMicroscope*)


DefineTests[PlotMicroscope,
	{
		Example[
			{Basic,"Plot an Object[Data, Microscope] with tiled images for interactivity:"},
			PlotMicroscope[{highResolutionDataMicroscope}],
			_Image,
			TimeConstraint->500,
			Stubs:>{
				(* rasterize to avoid pink boxes for interactivity *)
				PlotMicroscope[{highResolutionDataMicroscope}] = Rasterize[
					(* add an extra option here to prevent infinite stubs loop *)
					PlotMicroscope[{highResolutionDataMicroscope}, Map->True]
				]
			}
		],
		Example[
			{Basic,"Plot an Object[Data, Microscope] with tiled images for interactivity with multiple z-steps, channels, and time steps:"},
			(* This quiet is used because the TimeObject changed from 12.0.1 to 13.3.1. However we only support PlotMicroscope in CCD on 13.3.1, but need 12.0.1 tests to pass *)
			Quiet[
				PlotMicroscope[{multiResolutionDataMicroscope}],
				{DateString::arg}
			],
			_Image,
			TimeConstraint->500,
			Stubs:>{
				(* rasterize to avoid pink boxes for interactivity *)
				PlotMicroscope[{multiResolutionDataMicroscope}] = Rasterize[
					(* add an extra option here to prevent infinite stubs loop *)
					PlotMicroscope[{multiResolutionDataMicroscope}, Map->True]
				]
			}
		],
		Example[
			{Options, PlotLabel, "Add a PlotLabel for an Object[Data, Microscope] with tiled images for interactivity:"},
			PlotMicroscope[{highResolutionDataMicroscope}, PlotLabel->"Microscope Data"],
			_Image,
			TimeConstraint->500,
			Stubs:>{
				(* rasterize to avoid pink boxes for interactivity *)
				PlotMicroscope[{highResolutionDataMicroscope}, PlotLabel->"Microscope Data"] = Rasterize[
					(* add an extra option here to prevent infinite stubs loop *)
					PlotMicroscope[{highResolutionDataMicroscope}, PlotLabel->"Microscope Data", Map->True]
				]
			}
		],
		Example[
			{Basic,"Plot hemocytometer images from a multiple Object[Data,Microscope] objects:"},
			PlotMicroscope[{Object[Data, Microscope, "id:zGj91a796Bej"],Object[Data, Microscope, "id:lYq9jRx96eJO"]}],
			SlideView[{Panel[plotImageP,_String]..}],
			TimeConstraint->120
		],
		Example[
			{Basic,"Plot a microscope object in a link:"},
			PlotMicroscope[Link[Object[Data, Microscope, "id:zGj91a796Bej"], Protocol]],
			plotImageP,
			TimeConstraint->120
		],
		Example[
			{Basic,"Plot images of Object[Sample]:"},
			PlotMicroscope[{Object[Sample, "id:kEJ9mqRz6303"]}],
			plotImageP,
			TimeConstraint->120
		],
		Example[
			{Additional,"Plot all images from a single Object[Data,Microscope] object with certain channel:"},
			PlotMicroscope[Object[Data, Microscope, "id:wqW9BP7DOv04"], Mode -> Epifluorescence, ImagingSite -> 1],
			SlideView[{(plotImageP)..}],
			TimeConstraint->120
		],
		Example[
			{Additional,"Plot Object[Data,Microscope] objects containing different numbers of images:"},
			PlotMicroscope[{Object[Data, Microscope, "id:zGj91a796Bej"],Object[Data, Microscope, "id:wqW9BP7DOv04"]},ImagingSite->1],
			SlideView[{Panel[plotImageP,_String],Panel[SlideView[{plotImageP..}],_String]}],
			TimeConstraint->300
		],
		Example[
			{Attributes,"ObjectP[Object[Data,Microscope]]","Plot a grid of images from a single Object[Data,Microscope] objects:"},
			PlotMicroscope[Object[Data,Microscope,"id:1ZA60vL7NKLD"],ImagingSite->1;;2],
			SlideView[{plotImageP..}],
			TimeConstraint->120
		],
		Example[
			{Attributes,"listable","Plot images from several Object[Data,Microscope] objects:"},
			PlotMicroscope[{Object[Data, Microscope, "id:zGj91a796Bej"],Object[Data, Microscope, "id:lYq9jRx96eJO"]}],
			SlideView[{Panel[plotImageP,_String]..}],
			TimeConstraint->120
		],

		Example[{Messages, "MissingImages", "An error is thrown when the data Object doesn't have the requested images field:"},
			PlotMicroscope[Object[Data, Microscope, "id:rea9jl1orKZr"]],
			$Failed,
			(* Messages:>{Error::MissingImages}*)
			Messages:>{Error::MissingImages}
		],
		Test[
			"Plot a microscope image:",
			PlotMicroscope[Object[Data, Microscope, "id:zGj91a796Bej"]],
			plotImageP,
			TimeConstraint->120
		],
		Test[
			"Plot Object[Data,Microscope] objects associated with different numbers of images:",
			PlotMicroscope[{Object[Data, Microscope, "id:zGj91a796Bej"],Object[Data, Microscope, "id:wqW9BP7DOv04"]},ImagingSite->1],
			SlideView[{Panel[plotImageP,_String],Panel[SlideView[{plotImageP..}],_String]}],
			TimeConstraint->300
		],
		Test[
			"Given a packet:",
			PlotMicroscope[Download[Object[Data, Microscope, "id:zGj91a796Bej"]]],
			plotImageP,
			TimeConstraint->120
		],

		(* Output tests *)
		Test["Setting Output to Result returns the plot:",
			PlotMicroscope[Object[Data, Microscope, "id:zGj91a796Bej"],Output->Result],
			plotImageP
		],

		Test["Setting Output to Preview returns the plot:",
			PlotMicroscope[Object[Data, Microscope, "id:zGj91a796Bej"],Output->Preview],
			plotImageP
		],

		Test["Setting Output to Options returns the resolved options:",
			PlotMicroscope[Object[Data, Microscope, "id:zGj91a796Bej"],Output->Options],
			ops_/;MatchQ[ops,OptionsPattern[PlotMicroscope]]
		],

		Test["Setting Output to Tests returns a list of tests:",
			PlotMicroscope[Object[Data, Microscope, "id:zGj91a796Bej"],Output->Tests],
			{(_EmeraldTest|_Example)...}
		],

		Test["Setting Output to {Result,Options} returns the plot along with all resolved options:",
			PlotMicroscope[Object[Data, Microscope, "id:zGj91a796Bej"],Output->{Result,Options}],
			output_List/;MatchQ[First@output,plotImageP]&&MatchQ[Last@output,OptionsPattern[PlotMicroscope]]
		],

		Test["Setting Output to Options returns all of the defined options:",
			Sort@Keys@PlotMicroscope[Object[Data, Microscope, "id:zGj91a796Bej"],Output->Options],
			Sort@Keys@SafeOptions@PlotMicroscope
		]
	},
	
